import React from 'react';
import s from './../Dialogs.module.css'

type MessagePropsType = {
    message: string
}
export const Message = (props: MessagePropsType) => {
    return (
        <>
        <div className={s.fromThem}>
            {props.message}
        </div>
    <div className={s.fromMe}>
            {props.message}
        </div>
        </>
    )
};
